import React from "react";
import "./VideoItem.css";

class SuggVideo extends React.Component {
  render() {
    const videoId = this.props.video.snippet.title;
    return (
      <div className="video-item item">
        <img
          className="ui image"
          src={this.props.video.snippet.thumbnails.high.url}
        />
        <div className="content">
          <div className="header">Video id- {videoId}</div>
        </div>
      </div>
    );
  }
}

export default SuggVideo;
